import React from 'react';
import moment from 'moment';
import Card from 'react-bootstrap/Card';
import ListGroup from 'react-bootstrap/ListGroup';

function Form(props) {
  return (
    <Card>
      <Card.Title>Details of {props.value.login}</Card.Title>
      <p>ID: {props.value.id}</p>
      <p>Login: {props.value.login}</p>
      <p>Link profile: {props.value.url}</p>
      <p>Created At: {moment(props.value.updated_at).format('YYYY-MM-DD')}</p>
    </Card>
  );
}

export default Form;
